import React from 'react';
import './Card.css';
import apple from '../assets/apple.png'

const Card = () => {
  return (
  <div className='cardcontainer'>
    <div className='card-img-container'>
      <img className="card-img" src={apple} alt="apple" width="180px" height="180px"/>
    </div>
  </div>);
};

export default Card;
